    #model = keras.models.load_model('path/to/location')
    # later
    l = []
    # main data as a set and has lists within containing each stocks data {[],[],[],[]}

    for stockdata in DATA:
        addStock = True
        ret = False
        industry = False
        if riskOp == "Low Risk":
            for i in stockdata[8:15]:
                if (i and float(i) <= -10):
                    addStock = False
            risk = addStock or (stockdata[3] and marketCap(stockdata[3]) > 10000000000)

        elif riskOp == "Medium Risk":
            for i in stockdata[8:15]:
                print(stockdata)
                if (i and float(i) <= -20):
                    addStock = False
            risk = addStock or (stockdata[3] and marketCap(stockdata[3]) > 2000000000)

        elif riskOp ==  "High Risk":
            for i in stockdata[8:15]:
                if (i and float(i) <= -30):
                    addStock = False
            risk = addStock or (stockdata[3] and marketCap(stockdata[3]) > 500000000)
